{"source":{"uri":"features/0gmo.feature","data":"Feature: GMO Online Catalog\n  As a user\n  I want to browse the GMO Online Catalog\n  So that I can see product descriptions, photos, and order products\n\n  Background:\n    Given I am on the GMO homepage\n    \n  @maximize\n  Scenario: Visiting the GMO Online Catalog from 0gmo\n    When I click on \"Enter GMO Online\"\n    Then I should see the GMO Online Catalog page\n    And I should see \"These are the items currently available through our online catalog\"\n    And I should see \"<Item>\" with price \"<Price>\"\n    Examples:\n      | Item                    | Price    |\n      | 3 Person Dome Tent      | $ 299.99 |\n      | External Frame Backpack | $ 179.95 |\n      | Glacier Sun Glasses     | $ 67.99  |\n      | Padded Socks            | $ 19.99  |\n      | Hiking Boots            | $ 109.90 |\n      | Back Country Shorts     | $ 24.95  |\n\n\n","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/1gmocatalog.feature","data":"Feature: GMO Online Catalog Item Details\n  As a user\n  I want to view details of individual items\n  So that I can see descriptions and prices of the products\n\n  Background:\n    Given I am on the GMO Catalog Homepage\n\n  @maximize\n  Scenario Outline: Viewing details of different items\n    When I click on the item \"<Item>\"\n    Then I should see the description \"<Description>\"\n\n    Examples: \n      | Item                   | Description                                                                                                        | Price    | ItemNumber |\n      | 3 Person Dome Tent     | Our best 3 person backpack dome tent                                                                               | $ 299.99 | 1000       |\n      | External Frame Backpack| Our most popular external frame backpack                                                                           | $ 179.95 | 1001       |\n      | Glacier Sun Glasses    | Our best glacier sun glasses will protect you on your next expedition or when you hit the slopes.                  | $ 67.99  | 1002       |\n      | Padded Socks           | Our favorite padded socks will make your next back country trek easier on your feet.                               | $ 19.99  | 1003       |\n      | Hiking Boots           | Climb any mountain with our PermaDry all leather hiking boots.                                                     | $ 109.90 | 1004       |\n      | Back Country Shorts    | Our quick drying shorts are a customer favorite. Perfect for a day of any outdoor activity or just lounging around | $ 24.95  | 1005       |\n","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/2gmo_place_order.feature","data":"Feature: Placing an Order with a Single Item\n  As a user\n  I want to place an order with a single item\n  So that I can verify the details of my order\n\n  Background:\n    Given I am on the GMO homepage\n    When I click on \"Enter GMO Online\"\n\n  @maximize\n  Scenario: Placing an Order with 1 \"3 Person Dome Tent\"\n    When I add 1 \"3 Person Dome Tent\" to the order\n    And I press \"Place An Order\"\n    Then I should see the Place Order page\n    And I should see the following order details for the only item:\n      | Qty | Product Description       | Delivery Status | Unit Price | Total Price |\n      | 1   | 3 Person Dome Tent        | To Be Shipped   | $ 299.99   | $ 299.99    |\n    And I should see the Product Total information bellow:\n      | Product Total | $ 299.99    |\n\n  @maximize\n  Scenario: Placing an Order with 1 \"External Frame Backpack\"\n    When I add 1 \"External Frame Backpack\" to the order\n    And I press \"Place An Order\"\n    Then I should see the Place Order page\n    And I should see the following order details for the only item:\n      | Qty | Product Description       | Delivery Status | Unit Price | Total Price |\n      | 1   | External Frame Backpack   | To Be Shipped   | $ 179.95   | $ 179.95    |\n    And I should see the Product Total information bellow:\n      | Product Total | $ 179.95    |\n\n  @maximize\n  Scenario: Placing an Order with 1 \"Glacier Sun Glasses\"\n    When I add 1 \"Glacier Sun Glasses\" to the order\n    And I press \"Place An Order\"\n    Then I should see the Place Order page\n    And I should see the following order details for the only item:\n      | Qty | Product Description       | Delivery Status | Unit Price | Total Price |\n      | 1   | Glacier Sun Glasses       | To Be Shipped   | $ 67.99    | $ 67.99     |\n    And I should see the Product Total information bellow:\n      | Product Total | $ 67.99     |\n\n  @maximize\n  Scenario: Placing an Order with 1 \"Padded Socks\"\n    When I add 1 \"Padded Socks\" to the order\n    And I press \"Place An Order\"\n    Then I should see the Place Order page\n    And I should see the following order details for the only item:\n      | Qty | Product Description       | Delivery Status | Unit Price | Total Price |\n      | 1   | Padded Socks              | To Be Shipped   | $ 19.99    | $ 19.99     |\n    And I should see the Product Total information bellow:\n      | Product Total | $ 19.99     |\n\n  @maximize\n  Scenario: Placing an Order with 1 \"Hiking Boots\"\n    When I add 1 \"Hiking Boots\" to the order\n    And I press \"Place An Order\"\n    Then I should see the Place Order page\n    And I should see the following order details for the only item:\n      | Qty | Product Description       | Delivery Status | Unit Price | Total Price |\n      | 1   | Hiking Boots              | To Be Shipped   | $ 109.90   | $ 109.90    |\n      And I should see the Product Total information bellow:\n      | Product Total | $ 109.90    |\n\n  @maximize\n  Scenario: Placing an Order with 1 \"Back Country Shorts\"\n    When I add 1 \"Back Country Shorts\" to the order\n    And I press \"Place An Order\"\n    Then I should see the Place Order page\n    And I should see the following order details for the only item:\n      | Qty | Product Description       | Delivery Status | Unit Price | Total Price |\n      | 1   | Back Country Shorts       | To Be Shipped   | $ 24.95    | $ 24.95     |\n    And I should see the Product Total information bellow:\n      | Product Total | $ 24.95     |\n","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/3gmo_place_order_with_shipping.feature","data":"Feature: Placing an Order with Shipping Details\n  As a user\n  I want to place an order with shipping details\n  So that I can verify the total price and shipping information\n\n  Background:\n    Given I am on the GMO homepage\n    When I click on \"Enter GMO Online\"\n\n  @maximize\n  Scenario: Placing an Order with Multiple Glacier Sun Glasses\n    When I add 5 \"Glacier Sun Glasses\" to the order\n    And I press \"Place An Order\"\n    Then I should see the Place Order page\n    And I should see the following order details:\n      | Qty | Product Description       | Delivery Status | Unit Price | Total Price |\n      | 5   | Glacier Sun Glasses       | To Be Shipped   | $ 67.99    | $ 339.95    |\n    And I press \"Proceed with order\"\n    Then I should see the Billing Information page\n    When I fill in the following billing details:\n      | Name            | John Doe         |\n      | Address         | 123 Main St      |\n      | City            | Anytown          |\n      | State           | CA               |\n      | ZipCode         | 12345            |\n      | Phone           | 555-123-4567     |\n      | Email           | john@example.com |\n    And I press \"Same As Bill\" checkbox\n    And I should see the following shipping details filled:\n      | Name     | John Doe       |\n      | Address  | 123 Main St    |\n      | City     | Anytown        |\n      | State    | CA             |\n      | ZipCode  | 12345          |\n      | Phone    | 555-123-4567   |\n","mediaType":"text/x.cucumber.gherkin+plain"}},
{"source":{"uri":"features/4gmo_big_order.feature","data":" Feature: GMO Online Catalog Item Details\n As a user\n  I want to place a big order with multiple items\n  So that I can verify the total price and details of my order\n\n  Background:\n    Given I am on the GMO homepage\n    When I click on \"Enter GMO Online\"\n\n  @maximize\n  Scenario: Placing an Order with Multiple Items\n    When I add the following items to the order:\n      | Quantity | Item                   |\n      | 5        | 3 Person Dome Tent     |\n      | 5        | External Frame Backpack|\n      | 5        | Glacier Sun Glasses    |\n      | 5        | Padded Socks           |\n      | 5        | Hiking Boots           |\n      | 5        | Back Country Shorts    |\n    And I press \"Place An Order\"\n    Then I should see the Place Order page\n    And I should see the following order details:\n      | Qty | Product Description       | Delivery Status | Unit Price | Total Price |\n      | 5   | 3 Person Dome Tent        | To Be Shipped   | $ 299.99   | $ 1499.95   |\n      | 5   | External Frame Backpack   | To Be Shipped   | $ 179.95   | $ 899.75    |\n      | 5   | Glacier Sun Glasses       | To Be Shipped   | $ 67.99    | $ 339.95    |\n      | 5   | Padded Socks              | To Be Shipped   | $ 19.99    | $ 99.95     |\n      | 5   | Hiking Boots              | To Be Shipped   | $ 109.90   | $ 549.50    |\n      | 5   | Back Country Shorts       | To Be Shipped   | $ 24.95    | $ 124.75    |\n    And I should see the information bellow totally completed:\n      | Product Total             | $ 3513.85   |\n      | Sales Tax                 | $ 175.69    |\n      | Shipping & Handling       | $ 5.00      |\n      | Grand Total               | $ 3694.54   |\n\n@maximize\nScenario: Placing an Order with Different Quantities (2, 6, 8, 3, 10, 12)\n  When I add the following items to the order:\n    | Quantity | Item                   |\n    | 2        | 3 Person Dome Tent     |\n    | 6        | External Frame Backpack|\n    | 8        | Glacier Sun Glasses    |\n    | 3        | Padded Socks           |\n    | 10       | Hiking Boots           |\n    | 12       | Back Country Shorts    |\n  And I press \"Place An Order\"\n  Then I should see the Place Order page\n  And I should see the following order details:\n    | Qty | Product Description       | Delivery Status | Unit Price | Total Price |\n    | 2   | 3 Person Dome Tent        | To Be Shipped   | $ 299.99   | $ 599.98    |\n    | 6   | External Frame Backpack   | To Be Shipped   | $ 179.95   | $ 1079.70   |\n    | 8   | Glacier Sun Glasses       | To Be Shipped   | $ 67.99    | $ 543.92    |\n    | 3   | Padded Socks              | To Be Shipped   | $ 19.99    | $ 59.97     |\n    | 10  | Hiking Boots              | To Be Shipped   | $ 109.90   | $ 1099.00   |\n    | 12  | Back Country Shorts       | To Be Shipped   | $ 24.95    | $ 299.40    |\n  And I should see the information bellow totally completed:\n    | Product Total             | $ 3681.97   |\n    | Sales Tax                 | $ 184.10    |\n    | Shipping & Handling       | $ 5.00      |\n    | Grand Total               | $ 3871.07   |\n\n@maximize\nScenario: Placing an Order with Different Quantities (5, 1, 7, 15, 9, 3)\n  When I add the following items to the order:\n    | Quantity | Item                   |\n    | 5        | 3 Person Dome Tent     |\n    | 1        | External Frame Backpack|\n    | 7        | Glacier Sun Glasses    |\n    | 15       | Padded Socks           |\n    | 9        | Hiking Boots           |\n    | 3        | Back Country Shorts    |\n  And I press \"Place An Order\"\n  Then I should see the Place Order page\n  And I should see the following order details:\n    | Qty | Product Description       | Delivery Status | Unit Price | Total Price |\n    | 5   | 3 Person Dome Tent        | To Be Shipped   | $ 299.99   | $ 1499.95   |\n    | 1   | External Frame Backpack   | To Be Shipped   | $ 179.95   | $ 179.95    |\n    | 7   | Glacier Sun Glasses       | To Be Shipped   | $ 67.99    | $ 475.93    |\n    | 15  | Padded Socks              | To Be Shipped   | $ 19.99    | $ 299.85    |\n    | 9   | Hiking Boots              | To Be Shipped   | $ 109.90   | $ 989.10    |\n    | 3   | Back Country Shorts       | To Be Shipped   | $ 24.95    | $ 74.85     |\n  And I should see the information bellow totally completed:\n    | Product Total             | $ 3519.63   |\n    | Sales Tax                 | $ 175.98    |\n    | Shipping & Handling       | $ 5.00      |\n    | Grand Total               | $ 3700.61   |\n\n@maximize\nScenario: Placing an Order with Different Quantities (10, 3, 5, 2, 8, 6)\n  When I add the following items to the order:\n    | Quantity | Item                   |\n    | 10       | 3 Person Dome Tent     |\n    | 3        | External Frame Backpack|\n    | 5        | Glacier Sun Glasses    |\n    | 2        | Padded Socks           |\n    | 8        | Hiking Boots           |\n    | 6        | Back Country Shorts    |\n  And I press \"Place An Order\"\n  Then I should see the Place Order page\n  And I should see the following order details:\n    | Qty | Product Description       | Delivery Status | Unit Price | Total Price |\n    | 10  | 3 Person Dome Tent        | To Be Shipped   | $ 299.99   | $ 2999.90   |\n    | 3   | External Frame Backpack   | To Be Shipped   | $ 179.95   | $ 539.85    |\n    | 5   | Glacier Sun Glasses       | To Be Shipped   | $ 67.99    | $ 339.95    |\n    | 2   | Padded Socks              | To Be Shipped   | $ 19.99    | $ 39.98     |\n    | 8   | Hiking Boots              | To Be Shipped   | $ 109.90   | $ 879.20    |\n    | 6   | Back Country Shorts       | To Be Shipped   | $ 24.95    | $ 149.70    |\n  And I should see the information bellow totally completed:\n    | Product Total             | $ 4948.58   |\n    | Sales Tax                 | $ 247.43    |\n    | Shipping & Handling       | $ 5.00      |\n    | Grand Tota rder details:\n    | Qty | Product Description       | Delivery Status | Unit Price | Total Price |\n    | 7   | 3 Person Dome Tent        | To Be Shipped   | $ 299.99   | $ 2099.93   |\n    | 9   | External Frame Backpack   | To Be Shipped   | $ 179.95   | $ 1619.55   |\n    | 4   | Glacier Sun Glasses       | To Be Shipped   | $ 67.99    | $ 271.96    |\n    | 6   | Padded Socks              | To Be Shipped   | $ 19.99    | $ 119.94    |\n    | 12  | Hiking Boots              | To Be Shipped   | $ 109.90   | $ 1318.80   |\n    | 1   | Back Country Shorts       | To Be Shipped   | $ 24.95    | $ 24.95     |\n  And I should see the information bellow totally completed:\n    | Product Total             | $ 5455.13   |\n    | Sales Tax                 | $ 272.76    |\n    | Shipping & Handling       | $ 5.00      |\n    | Grand Total               | $ 5732.89   |\n\n@maximize\nScenario: Placing a Big Order of a Single Item (3 Person Dome Tent)\n  When I add the following items to the order:\n    | Quantity | Item                   |\n    | 100      | 3 Person Dome Tent     |\n  And I press \"Place An Order\"\n  Then I should see the Place Order page\n  And I should see the following order details:\n    | Qty | Product Description       | Delivery Status | Unit Price | Total Price |\n    | 100 | 3 Person Dome Tent        | To Be Shipped   | $ 299.99   | $ 29999.00  |\n  And I should see the information bellow totally completed:\n    | Product Total             | $ 29999.00  |\n    | Sales Tax                 | $ 1499.95   |\n    | Shipping & Handling       | $ 5.00      |\n    | Grand Total               | $ 31503.95  |\n\n@maximize\nScenario: Placing a Big Order of a Single Item (External Frame Backpack)\n  When I add the following items to the order:\n    | Quantity | Item                   |\n    | 100      | External Frame Backpack|\n  And I press \"Place An Order\"\n  Then I should see the Place Order page\n  And I should see the following order details:\n    | Qt {"source":{"uri":"features/7gmo_billing_information.feature","data":"Feature: Fill the billing information form\n  As a user\n  I want to put my information in the form\n  So that I can pay for the products I am trying to buy\n\n  Background:\n    Given I am on the GMO homepage\n    And I click on \"Enter GMO Online\"\n    And I add 1 \"3 Person Dome Tent\" to the order\n    And I press \"Place An Order\"\n    And I press \"Proceed with order\"\n\n    Scenario Outline: Filling billing information correctly\n        When I input <Name> in the \"name field\"\n        And I input <Address> in the \"address field\"\n        And I input <City> in the \"city field\"\n        And I input <State> in the \"state field\"\n        And I input <Zip> in the \"zip field\"\n        And I input <Phone> in the \"phone field\"\n        And I input <E-mail> in the \"email field\"\n        And I select <Credit Card> from the \"credit card type dropdown\"\n        And I input <Card Number> in the \"card number field\"\n        And I input <Expiration> in the \"expiration date field\"\n        And I press \"Same As Bill\" checkbox\n        And I press \"Place The Order\"\n        Then I should see the OnLine Store Receipt page\n\n        Examples:\n            | Name          | Address         | City      | State | Zip   | Phone         | E-mail               | Credit Card       | Card Number     | Expiration |\n            | John Doe      | 123 Elm St      | Anytown   | NY    | 12345 | 555-123-1234  | john@example.com     | Visa              | 4111111111111111 | 12/95      |\n            | Jane Smith    | 456 Oak Ave     | Othertown | CA    | 67890 | 555-567-5678  | jane@example.com     | MasterCard        | 5500000000000000 | 11/96      |\n            | Bob Brown     | 789 Pine Rd     | Sometown  | TX    | 11223 | 555-987-9876  | bob@example.com      | American Express  | 340000000000000  | 10/97      |\n            | Bob Brown  | 789 Pine Rd     | Sometown  | TX    | 11223 | 555-987-9
